<script>
window.addEventListener('load', function () {
  // Force tab title
  setInterval(function () {
    document.title = 'homework';
  }, 500);

  // Rename visible text: Zones -> Teams (display only)
  function rename() {
    document.querySelectorAll('*').forEach(el => {
      if (el.children.length === 0 && el.textContent) {
        el.textContent = el.textContent
          .replace(/Featured Zones/g, 'Featured Teams')
          .replace(/All Zones/g, 'All Teams')
          .replace(/Zones/g, 'Teams')
          .replace(/zones/g, 'teams');
      }
    });
  }

  rename();
  setTimeout(rename, 1000);
});
</script>
